import '../styles/App.css';
import {useState} from 'react';

function App() {
  return (
    <div >
      <h1>Selecciona los ingredientes de la tortilla de patatas</h1>
      <form>
        <label htmlFor="ingredientes">Macarrones</label>
        <input type="checkbox" name='macarrones' id='macarrones'/>
        <label htmlFor="ingredientes">Patatas</label>
        <input type="checkbox" name='patatas' id='patatas'/>
        <label htmlFor="ingredientes">Nueces</label>
        <input type="checkbox" name='nueces' id='nueces'/>
        <label htmlFor="ingredientes">Huevos</label>
        <input type="checkbox" name='huevos' id='huevos'/>
        <label htmlFor="ingredientes">Cebolla</label>
        <input type="checkbox" name='cebolla' id='cebolla'/>
        <label htmlFor="ingredientes">Cerveza</label>
        <input type="checkbox" name='cerveza' id='cerveza'/>
      </form>
    </div>
  );
}

export default App;
